import React, { Component } from 'react';

class MachineAssemblies extends Component {
  render() {
    return (
      <>
        <div className="w-full h-1/5">
          <span className="pl-4 underline">Main Unit</span>
        </div>
        <div className="w-full h-1/5">
          <span className="pl-4 underline">Paper Input</span>
        </div>
        <div className="w-full h-1/5">
          <span className="pl-4 underline">Paper Output</span>
        </div>
        <div className="w-full h-1/5">
          <span className="pl-4 underline">Finishing</span>
        </div>
        <div className="w-full h-1/5">
          <span className="pl-4 underline">Controller</span>
        </div>
      </>
    );
  }
}

export default MachineAssemblies;
